import Media from 'react-media';


// REturn IMA
export default function REturnIMA() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <SmAllScreen />}
     {matches.medium && <MediUMScreen />}
     {matches.large && <LaRgeScreen />}
    </>
   )}
  </Media>
 )
};


export const ScreenLarge = () => (
 <div className='flex-img-nuestras'>
  <img src={'/img/choosreen.png'} alt={'phone image'} />
 </div>
);

export const ScreenSmall = () => (
 <div className='flex-img-nuestras-sm'>
  <img src={'/img/choosreen.png'} alt={'phone image'} />
 </div>
);
